// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;
import "./Escrow.sol";
import "hardhat/console.sol";

contract EscrowFactory {
      event EscrowCreated(escrow newEscrow);
      address[] public escrows;
      struct escrow {
            address escrowAddress;
            address depositor;
            address arbiter;
            address beneficiary;
            uint256 amount;
      }

      function createEscrow(address _arbiter, address _beneficiary) external payable {
            Escrow _escrow= new Escrow(_arbiter, _beneficiary);
            console.log("Escrow address is %s", address(_escrow));
            (bool success, ) = address(_escrow).call{value: msg.value}("");
            require(success, "Sending Ether to Escrow failed");
            escrows.push(address(_escrow));
            escrow memory newEscrow = escrow((address(_escrow)),msg.sender, _arbiter, _beneficiary, msg.value);
            emit EscrowCreated(newEscrow);
      }

      function getEscrows() external view returns (address[] memory) {
            return escrows;
      }



}

